import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Wash",
      amount: 22.63,
      date: new Date(2023, 5, 12)
    }
  ];

  return (
    <div>
      <h2>Welcome To ECE 459 Learning REACT.JS FOR Engineers!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      />
    </div>
  );
}

export default App;
